import React from "react";
import "./App.css"

const App = () => {
  // let message = "Ola!"
  const [message, setMessage] = userState('hello world!');

  return (
    <>
      <div className="container">{ message }</div>
      <button onClick= {() => setMessage("Mudei mensagem!") } >
        Mudar mensagem
      </button>
    </>
  );
};

export default App;
